import { useParams} from 'react-router-dom'


const URL=""
const API=""

function MovieDet() {

    const {id}=useParams();
    const[movie,setMovie]=useState({})

    const getMovie=async()=>{
        try{
            const res= await fetch(URL+id+API)
            const mov=await res.json()
            setMovie(mov)
        }catch (e){
            console.error(e)
        }
    }


    return (
        <div>
            <h2>Movie Details {id}  </h2>

        </div>
    )
}

